func TestFloat32(t *testing.T) {
	speed1 := float32(-0.629999995231628)
	t.Logf("%f", speed1)
	if speed1 < 0 {
		speed1 = -1 * speed1
	}
	// speed64, _ := strconv.ParseFloat(fmt.Sprintf("%.2f", speed), 32)
	// Speed := float32(speed64)
	speed2 := float32(0.0)
	_, err := fmt.Sscanf(fmt.Sprintf("%.2f", speed1), "%f", &speed2)
	if err != nil {
		t.Logf("err:%#v", err)
	}
	//fmt.Scanf("", fmt.Sprintf("%.2f", speed))
	t.Logf("%f,transform to :%f", speed1, speed2)
}

func StringReplaceAll(ss *string) *string {
	*ss = strings.ReplaceAll(*ss, " ", "")
	*ss = strings.ReplaceAll(*ss, "\n", "")
	*ss = strings.ReplaceAll(*ss, "\t", "")
	return ss
}

